import React from 'react'
import "jquery";
import "popper.js/dist/umd/popper"
import "bootstrap/dist/js/bootstrap";
import "bootstrap/dist/css/bootstrap.css";

function LoginHeader() {
  const [value, setvalue] = useState();
    const theme=useTheme();
    const isMatch=useMediaQuery(theme.breakpoints.down("md"));
  return (
    <React.Fragment>
    <AppBar sx={{background:'#063970',position:'fixed',top:0}}>
        <Toolbar>
           <ShoppingCartCheckoutIcon/>
           {
            isMatch?(
                <>
                <Typography>FASHION SHOPPEE</Typography>
                <DrawerComp/>
                </>
            ):(
                <>
                 <Tabs textColor="inherit" value={value} onChange={(e,value)=>setvalue(value)} indicateColor='secondary'>
                    {
                        Pages.map((page,index)=>(
                            <Tab key={index} label={page}/>
                        ))
                    }
            </Tabs>
            
            <Button sx={{marginLeft:'auto'}} variant='contained'>Login</Button>
            <Button sx={{marginLeft:'10px'}} variant='contained'>SignUp</Button>
            <Button sx={{marginLeft:'10px',color:'white'}}><AddShoppingCartIcon /></Button>

                </>
            )
           }
           
        </Toolbar>
        </AppBar>  
    </React.Fragment>
  );
}

export default LoginHeader
